import React from 'react';

export default ({name}) => {
    return (
        <div className = "search_container">
            <h1>{name}</h1>
            <table>
                <tr>
                    <td>時間</td>
                    <td>進貨／出貨</td>
                    <td>廠商</td>
                    <td>數量</td>
                </tr>
            </table>
        </div>

    );
}
